import { FormControlLabel, Radio, TextField } from "@material-ui/core";

export default function KeywordCheck(){
    const styles = {
        border:'1px solid black',
        width:'1510px',
        height:'700px'
      };
      const styles1 = {
        borderBottom:'1px solid black',
        width:'1510px',
        height:'90px',
        display:'flex',
        justifyContent: 'center',
      };

    return(
        <>
            <div style={styles}>
                <div style={styles1}>
                        <div style={{marginTop:'50px',fontWeight:'bold',fontSize:'13px'}}>검색: </div>
                        <TextField id="outlined-basic" label="Outlined" variant="outlined" size="small" style={{marginTop:'40px'}}/>
                        <div style={{marginLeft:'30px',marginTop:'50px',fontWeight:'bold',fontSize:'13px'}}>작업: </div>
                        <FormControlLabel value="female" control={<Radio />} label="Female" style={{marginTop:'27px',marginLeft:'5px'}} />
                </div>
            </div>
        </>
    );
}
